import React, { useState } from 'react';
import Sidebar from '../../../Component/SideBar/Sidebar';
import FillFromTankerForm from './Operation/Fill From Truck/Truck Filled'; // ✅ Import added
import Truckfill from './Operation/Fill From Truck/Truck Filled/Truckfill'; // ✅ Already correct

import './Oilmanagement.css';

const operations = [
  {
    id: 1,
    dateTime: '25/1/2024, 10:30:00 am',
    type: 'Tanker Fill',
    tanker: '1',
    truck: '-',
    quantity: '40,000',
    location: 'Refinery A',
    status: 'completed'
  },
  {
    id: 2,
    dateTime: '25/1/2024, 2:15:00 pm',
    type: 'Truck Fill',
    tanker: '1',
    truck: '1',
    quantity: '25,000',
    location: 'Mumbai Terminal',
    status: 'completed'
  },
  {
    id: 3,
    dateTime: '25/1/2024, 4:45:00 pm',
    type: 'Truck Fill',
    tanker: '2',
    truck: '3',
    quantity: '28,000',
    location: 'Bangalore Hub',
    status: 'pending'
  }
];

const Oilmanagement = () => {
  const [showForm, setShowForm] = useState(false);
  const [formData, setFormData] = useState({
    tankerId: 'TNK-001',
    product: 'Diesel',
    quantity: 1200,
    receivedDate: '2025-08-12',
    driverName: 'Ram Kumar'
  });

  const handleEdit = (id) => {
    console.log(`Edit operation ${id}`);
  };

  const handleDelete = (id) => {
    console.log(`Delete operation ${id}`);
  };

  const handleFillTanker = () => {
    setShowForm(true);
  };

  const handleFillTruck = () => {
    console.log('Fill Truck clicked');
  };

  const handleFormSubmit = (updated) => {
    console.log('Form submitted:', updated);
    setFormData(updated);
    setShowForm(false);
  };

  return (
    <div className="oil-dashboard">
      <Sidebar />
      <Truckfill data={formData} /> {/* ✅ Pass formData to avoid undefined error */}
      
      <div className="oil-content">
        <h1>Oil Management - Operations History</h1>

        <div className="oil-actions">
          <button onClick={handleFillTanker} className="fill-btn">Fill From Tanker</button>
          <button onClick={handleFillTruck} className="fill-btn">Fill Truck</button>
        </div>

        <table className="oil-table">
          <thead>
            <tr>
              <th>Date & Time</th>
              <th>Type</th>
              <th>Tanker</th>
              <th>Truck</th>
              <th>Quantity (L)</th>
              <th>Location</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {operations.map(op => (
              <tr key={op.id}>
                <td>{op.dateTime}</td>
                <td>{op.type}</td>
                <td>{op.tanker}</td>
                <td>{op.truck}</td>
                <td>{op.quantity}</td>
                <td>{op.location}</td>
                <td className={op.status === 'completed' ? 'completed' : 'pending'}>{op.status}</td>
                <td>
                  <button onClick={() => handleEdit(op.id)} className="edit-btn">Edit</button>
                  <button onClick={() => handleDelete(op.id)} className="delete-btn">Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        {showForm && (
          <FillFromTankerForm
            initialData={formData}
            onSubmit={handleFormSubmit}
            onCancel={() => setShowForm(false)}
          />
        )}
      </div>
    </div>
  );
};

export default Oilmanagement;
